Saikawa is a teacher at a fine-arts prep school. His colleague, Nashimoto, is a great guy and always stays by his side for him. Looking at Saikawa so depressed after holding his wedding yet breaking up even before submitting the marriage registration, Nasimoto instinctively gives him a kiss. Nashimoto who realized his feelings for Saikawa...!?

Hasumi from From Yesterday makes a cameo appearance as Saikawa's friend.

Included Oneshot &quot;And the Rose Coloured Days&quot;

Yang Shen - &lsquo;A work critic&rsquo; once said&hellip;
&quot;I&rsquo;ll become a dog that&rsquo;s stronger than you people! &quot;

What happens will happen, let the &lsquo;mystical system&rsquo; fulfill its &lsquo;wish&rsquo;. 
Here, Yang Shen will take famous names and act with arrogance and pride. Let us begin the show!

The meeting of the nation&rsquo;s actor and a rookie at a drama set. 
&ldquo;Did I do alright&hellip;?&rdquo;
A breathtaking romance between reality and drama!

Meet the Evil King Valt, ruler of the Continent of Darkness. After being defeated by a group of heroes, he was reborn as a human, with his powers intact!

&quot;I'll start over in this world. And this time the whole world will be mine!&quot;

Valt garners the attention of the elite adventurer Iris. With Iris as his guardian, he enrolls at the Royal Adventurer Training School and immediately surpasses his seniors with his abnormal power! In an unprecedented move, this maverick is designated &quot;level 0.&quot; He goes on to employ his talents as an Evil King to great effect, dominating the new world he finds himself in...

&quot;Can you give me some tips to sing well?&quot;

The head of the chorus club, Satomi, gets entangled with a yakuza called Kyouji and was asked for singing lessons. Kyouji really wants to get better at singing so he kidnaps Satomi every week despite his unwillingness to teach him to sing.

But before long, a strange friendship begins to grow between the two of them...? [Vioscans]

&ldquo;I wanted to tell you it&rsquo;s okay now.&rdquo;

Joo Giran was torn apart by guilt after his grandmother passed away. He had a one-night stand with Baek Sunkyung after meeting him at a club but&hellip;

&ldquo;I wish it was just the two of us forever.&rdquo;

They meet again as sunbae &amp; hoobae in the same major at the start of the semester celebration. Giran is strangely attracted to and forms an odd camaraderie with Sunkyung, who strides toward him unabated. Sunkyung stays by his side through thick and thin, as if Giran was his final destination.

A story set in the Edo period about youth, by Sakura Sawa. 
This is the Bakumatsu. Two childhood friends, Junnoshin and Hisashi, with their pride as warriors on the line, engage in friendly rivalry. There&rsquo;s the bright and trustworthy Junnoshin, and the dignified and steely Hisashi. The two of them spent many moments in their explosive youth together. Despite the days they spent together, Hisashi struggles with his thoughts as he believes that he should not lay with Junnoshin.
&ldquo;The two of us do not see the same thing.&rdquo; 
&ldquo;The two of us are seeing the same thing.&rdquo; 
A tale of the innocence and burning passion between two friends who understand each other, yet walk slightly different paths.

When the plain office-lady Rin Matsuda ran into an opening car door, she got mad and yelled at the rude driver, the handsome Kento Shigezawa. But he seemed to like it when she talks back to him?

&quot;I have just one request. Will you be my girlfriend?&quot;

A cute gap-love story between an intimidating-looking boss-man who's actually a big puppy dog, and a serious hard-working girl.

White-collar worker Gotou Shizuka is attacked by a slasher who suddenly appears in the heart of the shopping district. Just as she is lost to her wounds, she hears a voice ring in her head.

&quot;You have been defeated. Commencing termination countdown.&quot;

Due to the counsel of the &quot;Night Guide (Guidance),&quot; she narrowly escapes death and awakens with an ability that ordinary people do not possesses. In the same instance, this world became connected with another and monsters begin to spring forth&hellip;

Gotou makes a decision to fight against these monsters. With her positive nature and bold and carefree attitude, she throws herself into the heat of the battle while leveling up and making weapons.

Two heroes of the game Legend of Heroes 2 that were rotten water*.

Kang Jin-ho in the first place and Hong Yoo Hee in the second place.

One day, I opened my eyes and reincarnated as a character in the game&hellip;

&ldquo;Hey&hellip;you too?&rdquo;

&ldquo;Hey&hellip;me too!&rdquo;

The ending of Legend of Heroes 2 is the destruction of the human world.

But if there&rsquo;s two of us and we&rsquo;re not alone.

If it is also the #1 and #2 in the server rankings.

The path of rotten water begins for a perfect happy ending!

(*Rotten water is Korean slang for someone who has played a certain game for a long time and mastered everything. Think of them as oldbies, veterans, or game pros.)

An internet troll who wanted attention, the reader criticized his favorite web novel, saying: &ldquo;The protagonist is dumb and the author is s*upid.&rdquo;

Author: &ldquo;&hellip; Got it.&rdquo;

Unfortunately for him, the author actually listened to his (troll) feedback. The formerly lighthearted tale of a cute harem master suddenly became super dark and edgy. The reader could only helplessly look on as the protagonist was abused and betrayed, finally embarking on the road to becoming completely evil. Everything was a mess!

After that the reader transmigrated into a strange world. How come the person in front of him looks like the protagonist (evil undead version)? Just what is going on?!

The loner kid who entered school a month late because he was sick became friends with the most popular boy in school! But later on, he discovered that this heartthrob with a good reputation is actually not human? The loner kid who easily gets nightmares catches the Dream Demon's eye. 

&ldquo;Your dream is exceptionally tasty~&rdquo; 

It&rsquo;s hard to make friends at school. If you&rsquo;re not careful, you might get eaten by the Dream Demon~

This is the tale of a man who had mastered how to &ldquo;parry.&rdquo;

&ldquo;I have no talent at all&hellip;&rdquo;

At the age of 12, a young boy named Noru had decided to train himself in the mountains after being rejected by the capital&rsquo;s official training centers for being &ldquo;talentless.&rdquo; He believed that, with enough hard work and effort, he could one day become like the protagonists that populate his childhood stories. Full of determination, he would practice every day with his makeshift wooden sword, endlessly repeating the only sword technique he knew&mdash;&ldquo;parry.&rdquo; The hours turned into days, the days turned into months, and the months turned into years. Eventually, he had trained this one skill to such an extreme that he could snap a thousand branches with it. However, no matter how hard he tried, he couldn&rsquo;t get the desired result, he couldn&rsquo;t learn any new skills required to become a real adventurer. It may be time to let go of his dream. But he couldn&rsquo;t. Not just yet. Knowing this, he returned to the capital again.

This was a man of endless dedication, a man who used that dedication to become one of the strongest in the world. The only problem is, he didn&rsquo;t know it yet.

